import Layout from '../components/MyLayout';
import Link from 'next/link';
import { withAmp } from 'next/amp'

export const config = { amp: true };

function HomePage() {
  return (
    <div>
      <Head>
        <title>Naina Raisinghani</title>
        <link rel="icon" href="data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 100 100%22><text y=%22.9em%22 font-size=%2290%22>💩</text></svg>" />
        <script async key="amp-fx-collection" custom-element="amp-fx-collection" src="https://cdn.ampproject.org/v0/amp-fx-collection-0.1.js"
          />
      </Head>
      <Layout>
        <main>
            <h1>Hi! 👋🏾 My name is Naina!</h1>
            <div>
              Some random facts about me:
              <ul>
                <li>I'm Pakistani 🇵🇰.</li>
                <li>I live in the Bay Area in California.</li>
                <li>I love reading! Ask me about my love for <a href="https://www.goodreads.com/book/show/7201.As_the_Crow_Flies">As The Crow Flies by Jeffrey Archer</a></li>
                <li>I spend my weekends currently in self isolation learning how to bake, cook and play the keyboard!</li>
                <li>My sourdough starter is called Bread Pitt</li>
              </ul>
            </div>
            <br/>
            <div>
              Some random facts about me:
            </div>          
        </main>
      <style jsx>{`
      @font-face {
          font-family: 'Bai Jamjuree';
          font-style: sans-serif;
          src: url('https://fonts.googleapis.com/css?family=Bai+Jamjuree');
      }
      * {
          font-family: 'Bai Jamjuree', sans-serif;
          text-decoration: none;
      }
      h1 {
          color:red;
      }
      main {
        position: fixed;
        margin: 0;
        color: #333333;
      }

      main {
        top: calc(50% - 16px);
        left: 50%;
        transform: translate(-50%, -50%);
      }

      @media only screen and (max-width: 768px) {
        main {
          top: 4em;
          left: 1em;
          transform: translate(0%, 0%);
        }  
      }

    `}</style>
      </Layout>
    </div>
  );
}

export default HomePage;
